  false,\n\t\"url\": null,\n\t\"notes\": \"This is a progress report on the continuing
  effort of the Washington Division of Geology and Earth Resourcesn(DGER) to build
  a Library of public-record seismic data. Mylar or paper copies of more than 8,000
  km of reflectionnseismic data and some refraction seismic data have been acquired
  and are now available on a limited basis fornresearch or commercial purposes. DGER
  also holds reproducible, statewide, 1 :250,OOO-scale Bouguer gravityncompilations
  of Finn and others (1984). Other geophysical data are listed in Manson (1984, 1991),
  Open File Report 91-5\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
